import React from "react";
import * as d3 from "d3";

/**
 * Uncontrolled component that graphs a HeatMap given a data set and dimensions of the graph.
 * @param {*} param0 
 * @returns 
 */
const HeatMap = ({ data, dimensions }) => {

    // create svg element:
    var svgRef = d3.select("#rect").append("svg").attr("width", 800).attr("height", 200)

    // Add the path using this helper function
    svgRef.append('rect')
    .attr('x', 10)
    .attr('y', 120)
    .attr('width', 600)
    .attr('height', 40)
    .attr('stroke', 'black')
    .attr('fill', '#69a3b2');

    // Return the new svg component
    return <svg ref={svgRef} width={800} height={200} />;
}

export default HeatMap;
